content:
@网易严选 一直都是严选的深度中毒用户，过去一年，在上面买了7k+的东西。为啥喜欢严选，因为觉得严选很人性，服务和商品都很人性。事实证明我错了，我之所以觉得它人性，是因为我还接触到它冰冷的“规定”！

上周在严选买了8袋猫粮。前两天，家里的养的两只流浪猫跑出去了。这两天找他俩，身心疲惫。此时，猫粮到货了，才想起买了猫粮，这是他俩将近半年的猫粮。由于猫咪还没着落，想着先退货吧。

申请退货，过了一天，居然被拒绝了？看了一下，原来是猫粮不支持无理由退换货。我想网易这么人性的服务，打客服电话说下原因应该是可以同意退货的吧。我包裹都还没拆，从下单到现在还不到一周时间，不影响第二次销售的。然后我打电话，

